import React from "react";
// SCSS
import "./teamInfo.scss";

const about = () => (
  <div className="team__info flex-center">
    <div>
      <h4 className="font20 weight800">What I love to do</h4>
      <p className="font12 weight500">
        professional thinker who question, create, analyze, build, test and deliver.
      </p>
      <p className="font12 weight500">Read More</p>
    </div>
  </div>
);

export default about;
